 las condiciones y requisitos se realizar por el personal delegado para este fin.\r\nEs responsabilidad del asociado realizar la constitucin o renovacin de los CDATS o la apertura y pago oportuno del ahorro programado en los trminos establecidos, para poder participar en el sorteo, Cootep no asume responsabilidad alguna por la omisin de lo anterior.\r\nCada participante entrara en el sorteo una vez se valide el cumplimiento de los requisitos.','MOCOA','Solicitud de reportes de informacion','listado de asociados activos','adjuntos/REGLAMENTO_CAMPAA_CAPTACION_DE_AHORROS_2025_GERENCIA_OK.pdf','CERRADO',74),(377,'2025-12-09 14:19:07.162954','Base Asociados Habilitados para sorteo campaa captacin de Aportes','Cordial saludo se solicita amablemente la base de asociados que estaran habilitados para participar en el sorteo de la campaa de captacin de aportes (76) para el sorteo de las dos motocicletas el prximo 19/12/2025\r\nRequisitos a tener en cuenta:\r\nVigencia: 03/03/2025 al 28/11/2025\r\nSer asociado activo de la cooperativa y tener un documento de identificacin valido.\r\nAsociado que se retire, automticamente queda fuera del sorteo, los depsitos realizados no aplican en el reingreso a la cooperativa, para tal efecto deber nuevamente realizar pagos posteriores a su nueva vinculacin en los trminos y condiciones establecidas.\r\nNo requiere antigedad.\r\nNo aplica para el primer pago de aportes por concepto de afiliacin.\r\nEl asociado participante deber tener sus datos actualizados y estar al da en el pago de sus obligaciones por todo concepto con la cooperativa a la fecha de cierre de la campaa 28/11/2025, caso contrario no podr participar en el sorteo.\r\nEl premio no podr ser sustituido por dinero en efectivo, ni por cualquier otro bien, ni cedido o endosado a terceros salvo los casos que requieren representacin legal como es el caso de los menores de edad y entidades jurdicas. Cualquier gasto adicional no mencionado ni especificado en el presente reglamento y dems comunicaciones al respecto ser de exclusiva y total responsabilidad del ganador.\r\nCOOTEP podr efectuar modificaciones o adiciones al presente reglamento, para lo cual bastar con publicacin de la nueva versin de este, por el medio que considere idneo\r\nEl da del sorteo el 19/12/2025, la verificacin del cumplimiento de las condiciones y requisitos se realizar por el personal delegado para este fin a travs del aplicativo contable.\r\nLos pagos de aportes en mora no podrn participar en el sorteo.\r\nEl pago por reciprocidad en aportes no aplica para la participacin en el presente sorteo.\r\nSolo aplica para pagos realizados por ventanilla en las diferentes oficinas de Cootep.','MOCOA','Solicitud de reportes de informacion','listado de asociados activos','adjuntos/REGLAMENTO_CAMPAA_DE_CAPTACION_APORTES_2025.pdf','CERRADO',74),(378,'2025-12-09 14:32:18.971795','ARREGLO  VALIDADORA','CORDIAL SALUDO \r\n\r\nDE MANERA ATENTA SE SOLICITA EL ARREGLO O CAMBIO DE VALIDADORA DE CAJA','MOCOA','Hardware','impresoras y validadoras','','EN TRAMITE',14),(379,'2025-12-09 14:36:11.647689','Base Asociados Habilitados para sorteo campaa Octubre mes del Ahorros - Bicicletas','Cordial saludo, se solicita amablemente sacar el reporte de la totalidad de depsitos a los ahorros o aportes ordinarios voluntarios que hayan realizados los tesoritos para participar en la campaa para el sorteo de las 8 bicicletas, donde por cada $30.000, se le asignar un numero para participar en el sorteo de una de las ocho bicicletas, deposito que deba realizar en las diferentes agencias y corresponsal de Cootep.\r\nRequisitos a tener en cuenta:\r\nVigencia: 6 de octubre de 2025 al 5 de diciembre de 2025\r\nTener un documento de identificacin valido.\r\nSer asociado activo mi tesorito Cootep.\r\nTener los datos actualizados y estar al da en todas las obligaciones con la cooperativa a la fecha del sorteo es decir al 23/12/2025.\r\nEn caso de que el asociado se retire automticamente queda fuera del sorteo, no aplica reingreso a la cooperativa, para tal efecto deber nuevamente incrementar sus ahorros o aportes ordinarios. No requiere antigedad.\r\nLos valores en ahorros consignados para participar en esta campaa debern tener una permanencia mnima hasta la vigencia de esta es decir hasta el 5/12/2025.\r\nNo aplica para el primer pago de aportes por concepto de afiliacin y deposito por apertura de cuenta.\r\nEl premio no podr ser sustituido por dinero en efectivo ni por cualquier otro bien, ni cedido o endosado a terceros.\r\nLa cooperativa realizara la verificacin y depuracin correspondiente antes del sorteo segn los asociados participantes conforme a la informacin registrada en nuestra base de datos.\r\nCualquier gasto adicional no mencionado ni especificado ser de exclusiva y total responsabilidad del ganador.\r\nCOOTEP podr efectuar modificaciones o adiciones al presente reglamento, para lo cual bastar con publicacin de la nueva versin de este, por el medio que considere idneo.\r\nEl da del sorteo el 23/12/2025, la verificacin del cumplimiento de las condiciones y requisitos de los ganadores se realizar por el personal delegado para este fin, en caso de encontrarse un incumplimiento se volver a sortear.\r\nLos pagos de aportes en mora no podrn participar en el sorteo.\r\nSolo aplica para consignaciones realizadas en efectivo por ventanilla, en caja de cada una de las oficinas mencionadas en el artculo 4 del presente reglamento.\r\nEs responsabilidad del asociado o su representante legal realizar el depsito de ahorros o aportes voluntarios en los trminos establecidos indicando al cajero la participacin en la presente campaa, para poder vincularse en el sorteo, Cootep no asume responsabilidad alguna por la omisin de lo anterior.','MOCOA','Solicitud de reportes de informacion','listado de asociados activos','adjuntos/REGLAMENTO_OCTUBRE_MES_DEL_AHORRO_2025_ok.pdf','CERRADO',74),(380,'2025-12-09 14:45:35.460313','cambio de fecha','Buenas DIAS\r\nsolicito un cambio a de la fech